import React from 'react'

const FileUpload = () => {

    const fileUploadAndResize=(e)=>{
        console.log(e.target.files)
    };
  return (
    <div className='row'>
        <label>Choose File
            <input type='file'
                    multiple
                    accept='images/*'
                    hidden
                    onChange={fileUploadAndResize}
            />
        </label>
    </div>
  )
};

export default FileUpload
